    "Zero Boil Off System for Cryogen Storage Project",nt"tracking_summary": {ntt"total":
    2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:56:58.079605",nt"name": "zero-boil-off-system-for-cryogen-storage-project",nt"isopen":
    true,nt"url": null,nt"notes": "This work proposes to develop a zero boil
    off (ZBO) dewar using a two-stage pulse-tube cooler together with two innovative,
    continuous-flow cooling loops and an actively cooled shield. While a number of cryogenic
    refrigeration systems may be considered for such applications, none offers the same
    potential for low vibration, high reliability, and high efficiency as the pulse
    tube. The continuous-flow cooling loops are made possible by the presence of rectifying
    interfaces that convert the oscillating flow of the pulse-tube cryocooler into a
    steady flow of cold refrigerant gas that can readily be distributed throughout the
    volume of the dewar or over the surface of a shield, without need for a separate
    circulating pump.",nt"license_title": "U.S. Government Work",nt"extras":
